def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def generate_numbers(a, b):
    a_str, b_str = str(a), str(b)
    numbers = [a, b]
    for digit in a_str:
        numbers.append(int(digit + b_str[1:]))
        numbers.append(int(b_str[:-1] + digit))
    return numbers

def find_largest_prime(numbers):
    largest_prime = -1
    for number in numbers:
        if is_prime(number) and number > largest_prime:
            largest_prime = number
    return largest_prime

with open('test.in', 'r') as file:
    a, b = map(int, file.readline().split())

numbers = generate_numbers(a, b)
largest_prime = find_largest_prime(numbers)
largest_number = max(numbers) if largest_prime == -1 else largest_prime

with open('test.out', 'w') as file:
